function App() {

  const usersData = () => {
    const fetchUsersData = fetch('https://jsonplaceholder.typicode.com/users').then(Response => Response.json()).then(json => console.log(json))
    console.log(fetchUsersData);
  };

  const toDoData = () => {
    const fetchtoDoData = fetch('https://jsonplaceholder.typicode.com/todos').then(Response => Response.json()).then(json => console.log(json))
    console.log(fetchtoDoData);
  };


  const postsData = () => {
    const fetchPostData = fetch('https://jsonplaceholder.typicode.com/posts').then(Response => Response.json()).then(json => console.log(json))
    console.log(fetchPostData);
  };

  return (
    <div class="topnav">
      <a onClick={() => usersData()}>Users</a>
      <a onClick={() => toDoData()}>To do</a>
      <a onClick={()=> postsData()}>Posts</a>
    </div>
  );
}

export default App;
